import React from 'react';
import { CustomInputFile, Label } from './styled';
const Component = ({ actualizarStateImg }) => {
    return <CustomInputFile>
        <Label>Sube una imagen de tu producto</Label>
        <input type={"file"} label="Coloca un archivo .jpg, .png" name="files" multiple accept="images/*" onChange={actualizarStateImg} />
    </CustomInputFile>
}
export default Component;
export { Component as CustomInputFile }
